export const defaultDateFormat = 'YYYY.MM.DD';
export const defaultLineDateFormat = '____.__.__';
export const dateFormatMonth = 'YYYY.MM';

export const confirm = async (title, text) => {
  try {
    const htmlText = text.replace(/\n/g, '<br>');
    const result = await Swal.fire({
      title,
      html: htmlText,
      showCloseButton: true,
      showCancelButton: true,
      confirmButtonText: '확인',
      cancelButtonText: '취소',
      reverseButtons: true,
      closeButtonHtml: '<img src="/assets/images/icon/close.svg" alt="close" />',
    });

    return result.isConfirmed; // true: 확인 클릭시, false: 취소 클릭시
  } catch (error) {
    console.error('다이얼로그 오류:', error);
    return false;
  }
};
export const alert = async (title, text) => {
  try {
    const htmlText = text.replace(/\n/g, '<br>');
    const result = await Swal.fire({
      title,
      html: htmlText,
      showCloseButton: true,
      showCancelButton: false,
      confirmButtonText: '확인',
      reverseButtons: true,
      closeButtonHtml: '<img src="/assets/images/icon/close.svg" alt="close" />',
    });

    return result.isConfirmed;
  } catch (error) {
    console.error('다이얼로그 오류:', error);
    return false;
  }
};
